import React from 'react'
import {Link} from "react-router-dom";
const UserDetail = () => {
  return (
    <>
        <Link to={`/users`}>
        <div>Regresar</div>
        </Link>        
        <div>UserDetail</div>
    </>
  )
}

export default UserDetail
